import './App.css';
import Navbar from './components/NavBar'; // Make sure NavBar.jsx exists here
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      {/* Navbar always visible */}
      <Navbar />

      {/* Routes for pages */}
      <Routes>
        <Route
          path="/"
          element={
            <div style={{ padding: '2rem', color: 'black' }}>
              <h1>Welcome to CRISPR Learning!</h1>
              <p>This is the home page.</p>
            </div>
          }
        />
        {/* You can add more pages here */}
      </Routes>
    </Router>
  );
}

export default App;
